import React, {Component} from "react"


export default class DisplayData extends Component{
    constructor(props){
        super(props)
    }
    render(){
        let data = {id, name, city, country, employer, title, favoriteMovies}= this.props
        return(
            <div>
                {data}   
            </div>
        )
    }
}
